            WinButton uIAceptarButton = this.UIEndGameWindow.UIAceptarWindow.UIAceptarButton;
            #endregion

            // Iniciar '%USERPROFILE%\Desktop\TADS\Domino_Version_Infarto\DominoCliente\bin\Debug\DominoCliente.exe'
            ApplicationUnderTest uIDominóWindow12 = ApplicationUnderTest.Launch(this.JuegoEnteroPor4botsParams.UIDominóWindow12ExePath, this.JuegoEnteroPor4botsParams.UIDominóWindow12AlternateExePath);

