            // Iniciar '%USERPROFILE%\Desktop\TADS\Domino_Version_Infarto\DominoCliente\bin\Debug\DominoCliente.exe'
            ApplicationUnderTest uIDominóWindow = ApplicationUnderTest.Launch(this.JuegoEnteroPor4botsParams.UIDominóWindowExePath, this.JuegoEnteroPor4botsParams.UIDominóWindowAlternateExePath);

            // Escribir 'FERNANDO' en cuadro de texto 'txtBoxPlayerName'
